import React from 'react';

import { Container, Col, Row} from 'react-bootstrap';


const Home = () => {
    const SideBar = (props) => {
        return (
            <div className='side-bar'>
                <p>Side bar tab</p>

            </div>
        )
    }
    return (
        <div>
            <Container>
                <Row>
                    <Col><SideBar/></Col>
                    <Col>Main content</Col>
                </Row>
            </Container>
        </div>
    );
};

export default Home;
